import strutils
var poly = ""

proc react(a,b: char): bool=
  if a.toLowerAscii() == b.toLowerAscii():
    let ar = a.isLowerAscii()
    let br = b.isUpperAscii()
    return ((ar and br) or (not ar and not br))

var reactions = 1
for lwr in 'a'..'z':
  let upr = lwr.toUpperAscii()
  var cpoly = poly.split({lwr, upr}).join()
  while reactions != 0:
    reactions = 0
    var i: int = 0
    while i < len(cpoly)-1:
      let
        c1 = cpoly[i]
        c2 = cpoly[i+1]
      if react(c1, c2):
        cpoly.delete(i, i+1)
        reactions += 1
      inc i
  echo len(cpoly)